import React from 'react';

const ItemVariants = ({ variants }) => {
  return (
    <div>
      {variants.map(variant => (
        <div key={variant.id}>
          <h3>{variant.nominal}</h3>
          <p>{variant.price}</p>
        </div>
      ))}
    </div>
  );
};

export default ItemVariants;
